import { useEffect, useState } from 'react'
import Button from '@mui/material/Button'
function Content() {
  const [count, setCount] = useState(0)
  const handleAdd = () => {
    setCount(count + 1)
  }
  useEffect(() => {
    if (count > 4) {
      setCount(0)
    }
  }, [count])

  return (
    <div>
      <h1>{count}</h1>
      <Button
        className="btn btn-primary"
        variant="contained"
        onClick={handleAdd}
      >
        Run
      </Button>
    </div>
  )
}
export default Content
